import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

    render() {
        return (
            <div className="App">
                <header>
                    <nav className="navbar" role="navigation">
                        <div className="container-fluid">
                            <ul className="nav navbar-nav">
                                <li className="active">
                                    <a href="/users">Rest Test</a>
                                </li>
                                <li className="active">
                                    <a href="/graph/users">GraphQL Test</a>
                                </li>
                            </ul>
                        </div>
                    </nav>
                </header>
                <div>
                    <blockquote>
                        <p>GraphQL based API</p>
                    </blockquote>
                    <input type="button" value="Result" onClick={this.handleClick}/>
                </div>
            </div>
        );
    }

    handleClick() {
        console.log('click')
    }
}

export default App;
